import React from "react";
import {Navbar, Nav} from "react-bootstrap";
import { Link } from "react-router-dom";

const NavBar = () => {
    return (
        <Navbar bg="light" variant="dark">
            <Nav className="mr-auto">
                <span className="mr-3"><Link className="text-decoration-none" to="/">Home</Link></span>
                <span className="mr-3"><Link className="text-decoration-none" to="about">About</Link></span>
            </Nav>
        </Navbar>
    );
};

export default NavBar;
